import React, { Component } from 'react';
import './slideshow.scss';



const Slideshow=()=>{
    return(
      <div>
        <nav>
          <h1>The Blog</h1>
        </nav>
      
        <section class="property">
          <div class="property-details">
            <h2>The Title</h2>
          </div>
      
          <div class="property-options"></div>
      
          <section class="slideshow" st style="height: 420px;">
            <span id="target-1"></span>
            <span id="target-2"></span>
            <span id="target-3"></span>
            <span id="target-4"></span>
      
            <a href="#" class="play">play</a>
      
            <div class="slideshow-item item-1">
              <div class="progress">1 of 4</div>
              <img src="http://lorempixel.com/g/600/420" alt="" />
              <a href="#target-4" class="arrow arrow-prev"></a>
              <a href="#target-2" class="arrow arrow-next"></a>
            </div>
      
            <div class="slideshow-item item-2">
              <div class="progress">2 of 4</div>
              <img src="http://lorempixel.com/g/500/420" alt="" />
              <a href="#target-1" class="arrow arrow-prev"></a>
              <a href="#target-3" class="arrow arrow-next"></a>
            </div>
      
            <div class="slideshow-item item-3">
              <div class="progress">3 of 4</div>
              <img src="http://lorempixel.com/g/480/420" alt="" />
              <a href="#target-2" class="arrow arrow-prev"></a>
              <a href="#target-4" class="arrow arrow-next"></a>
            </div>
      
            <div class="slideshow-item item-4">
              <div class="progress">4 of 4</div>
              <img src="http://lorempixel.com/g/640/420" alt="" />
              <a href="#target-3" class="arrow arrow-prev"></a>
              <a href="#target-1" class="arrow arrow-next"></a>
            </div>
          </section>
      
          <div class="rest-of-body"></div>
        </section>
        </div>




      // <section class="slideshow">
      //   <div class="slideshow-container slide">
      //     <img src="https://tse4.mm.bing.net/th?id=OIP.KX82hFNecgRpUuhY52QdogHaHa&pid=Api&P=0&w=300&h=300"/>
      //     {/* <div class="text-container">
      //       <p> I work with text too! And I'm just testing length here and stuff it's cool you know because that's important to do I guess hey did I ever tell you about that time that I did that stuff with the thing</p>
      //     </div> */}
      //     <img src="https://www.19kala.com/image/cache/home-page/slide-show/zemestan-98/esfand/desktop/new/slideshow-huawei-n1-1300x460.jpg"/>
      //     <img src="http://placeimg.com/625/225/arch"/>
      //   </div>
      // </section>
      
      
    )
}
export default  Slideshow;
